import React, { Component } from 'react';

class Maps extends Component{

    initMap = () => {
        var map = new window.google.maps.Map(document.getElementById('map'), {
          center: {lat: -34.397, lng: 150.644},
          zoom: 6
        })
    };

    render() {

        return(
            <div id="map"></div>
        );
    }
}

export default Maps;
